import { initializeApp } from "firebase/app";
import { getAuth} from "firebase/auth";

const firebaseConfig = {
  apiKey: "AIzaSyDeT2Rvs5RXOEbF9KGet1ObitOSwoDqTcI",
  authDomain: "medicalapp-5fe82.firebaseapp.com",
  projectId: "medicalapp-5fe82",
  storageBucket: "medicalapp-5fe82.appspot.com",
  messagingSenderId: "588879271427",
  appId: "1:588879271427:web:509888df5a601442732036"
};

// Initialize Firebase
const app = initializeApp(firebaseConfig);
export const auth = getAuth(app);
